import React from 'react';

function OrderList({ orders }) {
  return (
    <div className="orders-list">
      <h3>Pesanan Anda</h3>
      <table className="table">
        <thead>
          <tr>
            <th>Produk</th>
            <th>Status</th>
            <th>Jumlah</th>
          </tr>
        </thead>
        <tbody>
          {orders.map((order) => (
            <tr key={order.id}>
              <td>{order.productName}</td>
              <td>{order.status}</td>
              <td>{order.quantity}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default OrderList;
